OneTo1.AppointmentsRoute=Ember.Route.extend({setupController:function(a,b){a.set("model",b);this.loadAppointment(a)},loadAppointment:function(a){a.set("loading",true);$.ajax({type:"GET",url:"http://dev.service.1to1help.net/rest/json/metallica/appt/"+0,success:function(b){if(b.length>0){var c=b[0];a.set("noAppointment",false);a.set("appointmentMode",c.apptType);a.set("counsellingType",c.apptFor);a.set("preferredDate1",c.preferedDate1);a.set("preferredDate2",c.preferedDate2);a.set("preferredTime1",c.preferedTime1);a.set("preferredTime2",c.preferedTime2);a.set("city",c.city);a.set("contactNumber",c.contactNo);a.set("status",c.status);a.set("loading",false)}else{a.set("noAppointment",true);a.set("preferredDate1",new Date());a.set("preferredDate2",new Date());a.set("loading",false)}},error:function(b){bootbox.alert("Unable to fetch appointment details");a.set("loading",false)}})}});